--
-- Table structure for table `wk_examine_advanced_config`
--

DROP TABLE IF EXISTS `wk_examine_advanced_config`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `wk_examine_advanced_config` (
  `advanced_config_id` bigint NOT NULL COMMENT '高级配置id',
  `examine_id` bigint DEFAULT NULL COMMENT '审批配置id',
  `node_handle_type` int DEFAULT NULL COMMENT '异常处理类型1：自动同意2：转交给指定人员处理',
  `node_handle_user` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '转交指定处理人',
  `node_handle_role` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '转交指定角色',
  `node_handle_parent_level` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '转交指定上级',
  `repeat_handle_type` int DEFAULT NULL COMMENT '当同一个审批人重复审批同一单据时处理类型1:仅首个节点需审批，其余自动同意2:仅连续审批时自动同意3:每个节点都需要审批',
  `reject_handle_type` int DEFAULT NULL COMMENT '审批被拒后重新提交类型1：跳过审批流已通过的层级，返回拒绝的层级2：返回审批流初始层级',
  `modify_permission_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '修改权限类型0：都不选1：提交申请时，员工不可修改固定审批人2：提交申请时，员工不可删除固定抄送人\r\n',
  `limit_time_status` int DEFAULT NULL COMMENT '是否开启限时配置:1是,0否',
  `create_user_id` bigint DEFAULT NULL COMMENT '创建人',
  `update_user_id` bigint DEFAULT NULL COMMENT '更新人',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建日期',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新日期',
  `batch_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '批次',
  `is_transferable` tinyint DEFAULT '1' COMMENT '是否可转交 0 否 1 是',
  `is_consult` tinyint DEFAULT '1' COMMENT '征求他人意见权限  0 否 1 是',
  `is_reject_choose_flow` tinyint(1) DEFAULT '0' COMMENT '是否允许撤回时选择撤回到哪个节点',
  `is_create_user_withdraw` tinyint(1) DEFAULT '1' COMMENT '是否允许创建人撤回',
  `privilege` int DEFAULT '7' COMMENT '操作权限（十进制转二进制）',
  PRIMARY KEY (`advanced_config_id`) USING BTREE,
  UNIQUE KEY `batch_id` (`batch_id`) USING BTREE,
  UNIQUE KEY `examine_id` (`examine_id`) USING BTREE,
  KEY `company_id` (`examine_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=DYNAMIC COMMENT='审批高级配置表';
/*!40101 SET character_set_client = @saved_cs_client */;

